### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Software Testing Basics**
- **Functional Requirements**: Specify the expected behaviors and relationships between inputs and outputs of a system.
- **Coupling Types**: Understanding different types of coupling between software modules (e.g., parameter coupling).

#### 2. **Partition Testing**
- **Equivalence Class Partitions**: Identifying partitions based on input ranges (e.g., shipping charges based on weight).
- **Boundary Value Analysis (BVA)**: Testing boundaries of input domains (e.g., passing score for an examination).

#### 3. **Logical Expressions**
- **Conjunctive Normal Form (CNF)**: Logical expressions in the form of conjunctions of disjunctions.
- **Disjunctive Normal Form (DNF)**: Logical expressions in the form of disjunctions of conjunctions.
- **Satisfiability and Tautology**: Understanding whether a predicate is satisfiable, a tautology, or neither.

#### 4. **Control Flow Graphs (CFG)**
- **All-Defs Coverage**: Ensuring all definitions of variables are covered.
- **Edge-Pair Coverage**: Covering all pairs of edges in a CFG.
- **Cyclomatic Complexity**: Measuring the complexity of a CFG.

#### 5. **Symbolic Execution**
- **Path Constraints**: Representing conditions that lead to specific paths in code.
- **Symbolic State**: Understanding the state of variables at the end of symbolic execution.

#### 6. **Truth Tables and Predicates**
- **RACC (Robustness, Accuracy, Completeness, Consistency) Pairs**: Identifying pairs in truth tables that cover all conditions.
- **RICC (Robustness, Integrity, Completeness, Consistency) Pairs**: Similar to RACC but with different criteria.

### Equations and Key Concepts

#### Logical Expressions
- **CNF Example**: \((a_1 \lor a_2) \land (b_1 \lor b_2) \land (b_1 \lor b_2)\)
- **DNF Example**: \((a_1 \land a_2) \lor (b_1 \land b_2 \land b_3)\)

#### Predicates
- **Predicate Example**: \( p = c \lor (a \land \neg b) \)
- **Predicate with Clauses**: \( p = a \land (b \lor c) \)

#### Control Flow Graphs
- **Cyclomatic Complexity Formula**: \( V(G) = E - N + 2 \) where \( E \) is the number of edges and \( N \) is the number of nodes.

#### Symbolic Execution
- **Path Constraint Example**: \( (x_0 = y_0) \land (3 \cdot x_0 + 10 < y_0 \cdot y_0) \)
- **Symbolic State Example**: \( \{r \mapsto r_{m}, p \mapsto \prod_{i \in [0, m-1]} r_i\} \)

